【送料無料】<br><!-- 商品説明 ここから --><div class=cartRap><h3>商品説明</h3><p>★ 限定カラーのスティックインパクトドライバー。<br /><br />★ 一台二役、LED・スティックインパクト。<br /><br />★ 電池パック内に制御回路を搭載し、電池セルを個別に監視。使い過ぎ(過放電)や高温になる前に給電を自動停止して電池を保護。<br /><br />★ ON/OFF試験や衝撃試験など現場での使い方を想定したさまざまな試験を実施。長時間の使用に持ちこたえる耐久性を確保。<br /><br />★ ライトは2WAY仕様。「スポットLED」は約2m先まで照射ができ、床下や天井裏での確認に便利。簡易ライトとして使える。「ワイドLED」はダウンライトやスイッチボックスなどの開口部内や、暗い場所で周囲照らし、作業を明るくサポート。<br /><br />★ 工具のトリガーを引くのと同じ操作感覚で使い易い。<br /><br />★ 増し締めも、錆びたネジの緩めも可能。<br /><br />★ 無段階切替可能。<br /><br />★ 手締め機能つき。</p></div><!-- 商品説明 ここまで --><!-- 商品仕様 ここから --><div class=cartRap><h3>スペック</h3><p>* チャック:ワンタッチビットロック方式(段付までの寸法が115mm・13mm)<br />* 最大締付トルク(弾性体締付トルク):25N・m(255kgf・cm)<br />* 回転数:0～2300回転/分<br />* 打撃数:0～2600回/分<br />* 本体寸法:全長235×全高146×全幅44mm(折り曲げ時) <br />* 本体質量(重量):550g<br />【セット内容・付属品】<br />* プラスチックケース:EZ9667(Black&Gold仕様)<br />* 急速充電器:EZ0L21<br />* 電池パック172V、15Ah(LJタイプ)×2個:EZ9L21</p></div><!-- 商品仕様 ここまで --><!-- 共通説明文（大）-->
